import React from 'react';
import Link from 'next/link';
import Head from 'next/head';
import AppLayout from '../components/Applayout';

const Home = () => {
    return (
        <>
            <Head>
                <title>NodeBird</title>
                <link rel="stylesheet" href="https://cdnjs.cloudflare.com/ajax/libs/antd/3.23.5/antd.css" integrity="sha256-yRcSqsYqa42pT9U2b+m8Mr/kkBncWkNcXKoDAyIr1MU=" crossorigin="anonymous" />
                <script src="https://cdnjs.cloudflare.com/ajax/libs/antd/3.23.5/antd.js" integrity="sha256-rIL+z9ih4BMIqERPga+RvtCVKHRhxjzeXGAzyaJcTfQ=" crossorigin="anonymous"></script>
            </Head>
            <AppLayout>
                <Link href="/about"><a>about</a></Link>
                <div>Hello, Next!</div>
            </AppLayout>        
        </>
    );
}

export default Home;
